import { HIEN_THI_CAC_PHONG, API_CALLING } from '../actions/types';

const initialState = {
  Phongs: [],
  callapidone: false
};

export default function(state = initialState, action) {
  switch (action.type) {
    case API_CALLING: {
      return {
          ...state,
          callapidone: false
      }
    }

    case HIEN_THI_CAC_PHONG: {
      return {
        ...state,
        Phongs: action.payload,
        callapidone: true
      };
    }

    default:
      return state;
  }
}
